import React from "react";
import {BrowserRouter, Route} from "react-router-dom";
import './App.css';
import { Http2SecureServer } from "http2";

const Accueil = () => {
  return(
    <h2>Accueil</h2>
  );
}

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Route path = "/accueil" component = {Accueil} />
      </BrowserRouter>

    </div>
  );
}

export default App;
